import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import Login from "./components/Login";
import Inicio from "./components/Inicio";
import Ticket from "./components/Ticket";
import Usuarios from "./components/Usuarios";
import Ruta from "./components/Ruta";

function App() {
  const [autenticado, setAutenticado] = useState(false);

  return (
    <Router>
      <Routes>

        {/* Ruta del login */}
        <Route path="/login" element={<Login setAutenticado={setAutenticado} />} />

        {/* Ruta protegida: Inicio */}
        <Route path="/inicio" element={ <Ruta autenticado={autenticado}> <Inicio /> </Ruta> }/>

        {/* Ruta protegida: Ticket */}
        <Route path="/ticket" element={ <Ruta autenticado={autenticado}> <Ticket /> </Ruta> }/>

        {/* Ruta protegida: Usuarios */}
        <Route path="/usuarios" element={ <Ruta autenticado={autenticado}> <Usuarios /> </Ruta> }/>

        {/* Redirigir al login por defecto */}
        <Route path="*" element={<Navigate to="/login" replace />} />

      </Routes>
    </Router>
  );
}

export default App;
